import React from "react";
import {Component} from "react";
import jsondata from "./data.json";


class Homepage extends Component {

      render(){
          return (
            <section>
            <div>
           {
             jsondata.map((val,i)=>{
               return (
                 <div>
                 <h1>{val[Object.keys(val)][0].PlaylistName}</h1>
               {console.log(val[Object.keys(val)][0].cover)}
               <img key={i} onClick={this.props.selected} className={i+1} src={val[Object.keys(val)][0].cover} style={{"height":"200px","width":"200px"}}/>
               </div>
               )
             })
           }
            </div>
            </section>
        )
      }
}

export default Homepage
